<li><strong>Git commit</strong>: 引擎版本的 Git 提交哈希值。</li>
<li><strong>Built</strong>: 引擎构建的时间。</li>
<li><strong>OS/Arch</strong>: 引擎运行的操作系统和架构。</li>
